text:
{ you can recognize survivors of abuse by their courage. when silence is so very inviting, they step forward and share their truth so others know they aren't alone.
jeanne mcelvaney }

to survivors of abuse - from a survivor - please don‚Äôt let whether someone will believe your story, or whether you have enough evidence, or whether you will not be mocked, whether you spoke up soon enough, or whether you were a ‚Äúgood person‚Äù - keep you from getting away, getting help, and later standing up and speaking the truth of what happened to you. there is often no ‚Äúevidence‚Äù of abuse. there are many abusers who appear to be ‚Äúgood people‚Äù to everyone else. there will be many details surrounding your story that someone could question you on that you might not remember. there are those who might not believe you. but you must be safe. you must heal. and the rest of us, the other survivors, we will believe you because we will hear and feel your story just like we do our own. and when you tell your story, you will strengthen another survivor who needs it. think about them when you need courage to get help, to share your story - not those who won‚Äôt believe you. the other survivors - think of them.  #believesurvivors #believewomen

